import './App.css';
import React, { useState } from "react";

function App() {

    const [change, setChange] = useState(false);

    return (
        <>
            <div className="App">
                <header className="header">CONNECT 4 GAME</header>

                <p onClick={() => setChange(!change)}>
                    {
                        change?
                            <div>
                                <p>hi</p>
                            </div>
                            :null
                    }
                </p>

            </div>
        </>
    )
}

export default App;
